import React from 'react';
import { Button } from './Button';
import '../App.css';
import './heroSection.css';

function heroSection() {
    return (
        <div className='hero-container'>
            <video src='../img/bg_vid.mp4' autoPlay loop muted />
            <h1>Test Hero</h1>
            <p>testing with hero section</p>
            <div className='hero-btns'>
                <Button className='btns' buttonStyle='btn--outline' buttonSize='btn--large'>Hero Button</Button>
                <Button className='btns' buttonStyle='btn--primary' buttonSize='btn--large'>Hero Button</Button>
                WATCH PRODUCT DEMO <i className='far fa-play-circle' />
            </div>
        </div>
    );
}

export default heroSection;
